/**
 *
 * TeamListView
 *
 */

import React from "react";
import PropTypes from "prop-types";
import { List as MuiList } from "@material-ui/core";

import InputAdornment from "@material-ui/core/InputAdornment";
import Typography from "@material-ui/core/Typography";
// import SearchIcon from "@material-ui/icons/Search";
// import Alert from "@material-ui/lab/Alert";

// import { DocumentStatuses } from "utils/enums";
import {
  MuiCardStyled,
  CardContentStyled,
  CardHeaderStyled,
  ListItemStyled,
  TextDiv,
  PaddedDiv,
} from "./styled";

const TeamListView = ({ list = [] }) => (
  <MuiCardStyled variant="outlined">
    {<CardHeaderStyled title={<Typography variant="h6"></Typography>} />}
    <CardContentStyled>
      <List list={list} />
    </CardContentStyled>
  </MuiCardStyled>
);

TeamListView.propTypes = {
  list: PropTypes.arrayOf(
    PropTypes.shape({
      text: PropTypes.string.isRequired,
      version: PropTypes.string,
      status: PropTypes.string,
    })
  ).isRequired,
};

const List = ({ list }) => {
  console.log("ebsnie");
  console.log(list);
  if (list.length > 0) {
    return (
      <MuiList dense={false}>
        {list.map((item, index) => (
          <ListItemStyled key={index}>
            <TextDiv>
              <Typography variant="body2">{item.name}</Typography>
            </TextDiv>
          </ListItemStyled>
        ))}
      </MuiList>
    );
  }
  return (
    <PaddedDiv>
      {/* <Alert severity="info">No items to display!</Alert> */}
    </PaddedDiv>
  );
};

List.propTypes = {
  list: PropTypes.array,
};

export default TeamListView;

